function PastGames({ past }) {

    const games = [];
    for (const game of Object.keys(past)) {
        games.push(
            <div key={game}>
                <tr style={{margin:10}}><td><h2>Game {game}</h2></td>
                <td><h3>{past[game].map(el => {
                    return (<div>{el}</div>)
                })}</h3></td></tr>
            </div>
        )
    }

    return (
        <div>
            {past === {} ? <h3>No past games</h3> : games}
        </div>
    )
}

export default PastGames;
